webpackJsonp([0xf927f8900006],{699:function(e,a){e.exports={data:{page:{id:"/Users/manrajsingh/Github/blog/content/pages/1--about/index.md absPath of file >>> MarkdownRemark",html:'<p>I’m a Software Engineer and am currently working with the Platform team at <a href="https://practo.com/">Practo</a> solving healthcare related problems. Previously, I was working with the datascience team which got me interested in Machine Learning and have been teaching myself about its practical and research aspects ever since.</p>\n<p>I’ve been contributing to Open Source for close to 4 years now and been actively involved with organizations such as <a href="https://github.com/tensorflow">TensorFlow</a>, <a href="https://duckduckhack.com/u/manrajgrover/">DuckDuckGo</a>, and <a href="https://mozillians.org/en-US/u/manrajsingh/">Mozilla</a> and currently heavily involved in building <a href="https://github.com/tensorflow/tfjs">TensorFlowJS</a> and it’s ecosystem. Over the past few years, some of my side project like <a href="https://github.com/manrajgrover/halo">halo</a>, <a href="https://github.com/manrajgrover/SingleDivProject">SingleDivProject</a>, <a href="https://github.com/manrajgrover/football-cli">football-cli</a> and <a href="https://github.com/manrajgrover/organize-cli">organize-cli</a> attracted great attention which got them on Github Trending list. I’ve also mentored students during <a href="https://codein.withgoogle.com/archive/2017/">Google Code-In, 2017</a> and <a href="https://railsgirlssummerofcode.org/">Rails Girls Summer of Code, 2018</a>.</p>\n<p>I’ve studied <a href="https://en.wikipedia.org/wiki/Instrumentation_and_control_engineering">Instrumentation and Control Engineering</a> at <a href="http://www.nsit.ac.in/">Netaji Subhas Institute of Technology, University of Delhi</a>. During my studies, alongside Open Source Code contributions, I was actively involved in Mozilla’s regional community as a Core Contributor and was invited to attend Mozilla Leadership Summit where I got the opportunity to understand Mozilla’s vision, shape strategy to grow the community and hone my leadership skills. Leading IEEE college chapter holding general secretary helped me experience and learn from the dynamics of planning, budgeting, and organizing regional and college events.</p>\n<p>Have a look at my <a href="https://manrajsingh.in/resume/Manraj%20Singh%20Grover.pdf">resume</a> for more information.</p>\n<p>Through this blog, I wish to share my learnings and experiences and explain them in a more pragmatic manner.</p>',frontmatter:{title:"About"}},footnote:{id:"/Users/manrajsingh/Github/blog/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<p>Copyright © <a href="https://manrajsingh.in/">Manraj Singh</a> | Powered by <a href="https://www.gatsbyjs.org/">GatsbyJS</a></p>'}},pathContext:{slug:"/about/"}}}});
//# sourceMappingURL=path---about-fd68a1c1b4b345eedc42.js.map